for /d %%F in ('dir /b /s /a-d MyFolder') do (
    for /d %%G in ('dir /b /s /a-d MyFolder2') do (
        for /f "delims=" %%H in ('dir /b /s /a-d MyFolder2/*.txt') do (
            set file=%%H
        )
